smw-showingresults:
This message is used on some special pages such as [[Special:WantedCategories]]. Parameters:
* $1 ― the maximum number of results in the batch shown, starting at the item indicated by the next parameter
* $2 ― the number of the first item listed

Note that numbers given in $1 and $2 are preformated (and may contain locale-specific group separators or digits), so they cannot be used in the 1st parameter for the <code><nowiki>{{</nowiki>PLURAL:''number''<nowiki>|</nowiki>''textual variants...''<nowiki>}}</nowiki></code> parser funtion, which only accepts raw numbers written with ASCII digits.

